import React from 'react';
import './Dashboard.css';
// Ensure all these are used below!
import { Home, Calendar, Ticket, User, Bell, Search } from 'lucide-react';

const Dashboard = () => {
  return (
    <div className="dashboard-container">
      {/* 1. Using Bell and Search */}
      <div className="header">
        <div className="logo-section">
          <div className="logo-icon">ES</div>
          <span className="logo-text">EventSphere</span>
        </div>
        <Bell size={24} /> 
      </div>

      <div className="search-container">
        <Search size={18} className="search-icon" />
        <input type="text" placeholder="Search events..." />
      </div>

      {/* ... other code ... */}

      {/* 2. Using Ticket and User in Nav */}
      <div className="bottom-nav">
        <div className="nav active"><Home size={20} /><span>Home</span></div>
        <div className="nav"><Calendar size={20} /><span>Events</span></div>
        <div className="nav"><Ticket size={20} /><span>My Events</span></div>
        <div className="nav"><User size={20} /><span>Profile</span></div>
      </div>
    </div>
  );
};
